  // 重要！页面导航
  var $titleBar = $('.title-bar');
  var $title = $titleBar.children('h2');
  var $titleVisb = $title.filter('.visible');
  var $titleInvisb = $title.filter('.invisible');
  var $subTitle = $titleBar.find('.primary>.sub-title');
  var $type = $titleBar.find('.primary>.type');
  var $pics = $('.pics');
  var $navBtn = $('.nav-btn');
  var $loading = $('.title-bar .loading');
  var $progress = $loading.children('.progress');
  var $bottomHint = $('.bottom-hint');

  $(document).on('click','.pics img',function(){
    window.open($(this).attr('src'));
  })

  function createXHR(){  
      var xhr = null;  
      try {  
          // Firefox, Opera 8.0+, Safari，IE7+  
          xhr = new XMLHttpRequest();  
      }  
      catch (e) {  
          // Internet Explorer   
          try {  
              xhr = new ActiveXObject("Msxml2.XMLHTTP");  
          }  
          catch (e) {  
              try {  
                  xhr = new ActiveXObject("Microsoft.XMLHTTP");  
              }  
              catch (e) {  
                  xhr = null;  
              }  
          }  
      }  
      return xhr;  
  }

  function average(array) {
    var s = 0;
    for (i in array) {
      s += array[i];
    };
    return s/array.length;
  };
 
  function navAction(sort,index) {
      if (index == -1) {
        return false;
      };

      var theInfo = info[sort][index];
      $titleBar.children('.en').html('0'+(index+1).toString());
      $title.html(theInfo.title);
      $subTitle.html(theInfo.sub_title);
      $type.html(theInfo.type);
      $titleVisb.width($titleInvisb.width()+4);

      window.stop();
      $loading.removeClass('done');
      $progress.css('width', 0);
      $pics.children('img, video').attr("src","").remove();

      var videoSrc = theInfo.video;
      if (videoSrc) {
        var poster = 'img/'+theInfo.name+'/poster.png';
        $pics.append("<video src='"+videoSrc+"' poster='"+poster+"' alt='' controls></video>")
      }

      var desc = theInfo.desc;
      if (desc) {
        $pics.children('.desc').html(desc).show();
      } else {
        $pics.children('.desc').html('').hide();
      }

      if (theInfo.is_ajax == false) {
        for (i in theInfo.content) {
          var src = theInfo.content[i];
          $pics.append(("<img src=" + src + " alt='' />"));
        }
        $pics.append($bottomHint);
        return false;
      }

      var percentArray = [];

      for (i in theInfo.content) {
        $pics.append("<img src='img/default.png' alt='' />");
        percentArray.push(0);
        loadImg(theInfo.content[i],i)
      }

      function loadImg(src,idx) {

        var xhr = createXHR();
        xhr.open('get', src, true);
        xhr.send();

        xhr.onreadystatechange=function() {
          if(xhr.readyState==2) {
            $pics.children('img').eq(idx).replaceWith("<img src=" + src + " alt='' />");
          }
        }

        xhr.onprogress = function(event){
          if(event.lengthComputable){
              var percentSingle = (100*event.loaded/event.total).toFixed(2);
              percentArray[idx] = Number(percentSingle);
              var percent = average(percentArray);
              // console.log(percentArray);
              // console.log(percent);
              $progress.css('width', percent+'%');
              if (percent>99) {
                $loading.addClass('done');
              }
          }
        };

        xhr.onload = function(event){

      if((xhr.status >= 200 && xhr.status < 300) || xhr.status == 304){  
        console.log('Request Done: '+ xhr.status);
      }
      else{  
        console.log('Request Failed: '+ xhr.status);  
      }

        }  
      }

      $pics.append($bottomHint);

  }

  $('.nav-design').click(function(){

    var sort = $(this).attr('id');
    navAction(sort,0);
    
    $('.main-content').scrollTop(0);

    var $slide = $("<div class='swiper-slide'><img src='' alt=''></div>");
    mySwiper.removeAllSlides();
    for (i in info[sort]) {
      $slide.children('img').attr('src',info[sort][i].cover);
      mySwiper.appendSlide($slide.clone());
    };
    
  });

  // 轮播图
  var mySwiper = new Swiper ('.swiper-container', {

      direction: 'horizontal',
      speed: 500,
      
      pagination: {
        el: '.swiper-pagination',
        clickable: true,
      },
      
      navigation: {
        nextEl: '.nav-btn.next .icon',
        prevEl: '.nav-btn.prev .icon',
        disabledClass: 'disabled',
      },

      on: {
        slideChangeTransitionStart: function(){
          var sort = $('.nav-design.active').attr('id');
          var index = this.activeIndex;
          navAction(sort,index);
          $('.main-content').scrollTop(0);
        },
      },

  });


  // 标题栏适应和动画
  $('.main-content').scroll(function(){
    if (!$('body').is('.detail')) {
      return false;
    }
    var offset = $pics.offset().top-40;
    // console.log(offset)
    if (offset<-86) {
      $titleBar.addClass('fold')
      $navBtn.addClass('fold')
    } else {
      $titleBar.removeClass('fold')
      $navBtn.removeClass('fold')
    }
  })


  // PC小屏幕适应
  function globalAdapt() {
    var winHeight = $(window).height();
    if (winHeight<768) {
      $('body').addClass('adaption');
      $titleBar.css('top',$('.main-content').height()-$titleBar.height()-30);
    } else {
      $('body').removeClass('adaption');
      $titleBar.css('top',$('.main-content').height()-$titleBar.height()-50);
    };
    // console.log($('.main-content').height(),$titleBar.height())
  }

  function navAdapt() {
    var $navCap = $('nav>p');
    var navCapHeight = ($('.side-nav').height()-$('.side-nav .logo').innerHeight()-82-20)/$navCap.length;
    $navCap.height(navCapHeight);
  }

  globalAdapt();
  navAdapt();

  window.onresize = function(){
    globalAdapt();
    navAdapt();
  }


  // 重要！页面交互
  $('nav>p').click(function(){
    var $mainTitle = $('.main-content>h2');
    var cnTitle = $(this).children('.main-text').html();
    var enTitle = $(this).attr('data-en');
    $mainTitle.children('.cn').html(cnTitle);
    $mainTitle.children('.en').html(enTitle);
    $(this).addClass('active').siblings().removeClass('active');
  })

  $('#nav-resume').click(function(){
    $('.portrait, .articles, .main-content>.round').removeClass('hide');
    $('.banner, .title-bar, .pics, .nav-btn, .contact').addClass('hide');
    $('body').removeClass('detail preview contact-me').addClass('resume');
    $('.title-bar .btn').removeClass('nav-back').children('p').html('作品详情');
    $('.title-bar, .nav-btn').removeClass('top fold');
    $('.main-content').scrollTop(0);
    $titleVisb.css('width','auto');
  })

  $(document).on('click','.nav-design',function(){
    $('.banner, .title-bar, .nav-btn').removeClass('hide');
    $('.portrait, .articles, .pics, .contact, .main-content>.round').addClass('hide');
    $('.title-bar, .nav-btn').removeClass('top fold');
    $('body').removeClass('resume detail contact-me').addClass('preview');
    $('.main-content').scrollTop(0);
    $('.title-bar .btn').removeClass('nav-back').children('p').html('作品详情');
    $titleVisb.css('width','auto');
  });

  $('.title-bar .btn').click(function(){
    if($(this).is('.nav-back')) {
      $('.banner, .title-bar, .nav-btn').removeClass('hide');
      $('.portrait, .articles, .pics, .contact, .main-content>.round').addClass('hide');
      $('.title-bar, .nav-btn').removeClass('top fold');
      $('body').removeClass('resume detail contact-me').addClass('preview');
      $('.main-content').scrollTop(0);
      $(this).children('p').html('作品详情');
      $titleVisb.css('width','auto');
    } else {
      $('.pics, .title-bar').removeClass('hide');
      $('.portrait, .articles, .banner, .contact, .main-content>.round').addClass('hide');
      $('.title-bar').addClass('top');
      $('body').removeClass('resume preview contact-me').addClass('detail');
      $(this).children('p').html('返回');
      $titleVisb.width($titleInvisb.width()+4);
    }
    $(this).toggleClass('nav-back');
  })

  $('#nav-contact').click(function(){
    $('.contact, .main-content>.round').removeClass('hide');
    $('.portrait, .articles, .banner, .title-bar, .pics, .nav-btn').addClass('hide');
    $('body').removeClass('detail preview resume').addClass('contact-me');
    $('.title-bar .btn').removeClass('nav-back').children('p').html('作品详情');
    $('.title-bar, .nav-btn').removeClass('top fold');
    $('.main-content').scrollTop(0);
    $titleVisb.css('width','auto');
  })

  $('.portrait .btn').click(function(){
    $('.nav-design').eq(0).trigger('click')
  });

