  function renderIcon (name) {
    var data = eval(name+'IconData');
    var params = {
      name: 'icon-'+name,
      container: document.getElementById('icon-'+name),
      renderer: 'svg',
      loop: false,
      autoplay: false,
      speed: 0.5,
      animationData: data
    };
    lottie.loadAnimation(params);
  };

  var iconNames = ['resume','ui','web','h5','theme','contact']

  for (i in iconNames) {
    renderIcon(iconNames[i]);
  };

